import {
    MenuUnfoldOutlined,
    MenuFoldOutlined,
    UserOutlined,
    VideoCameraOutlined,
    UploadOutlined,
} from '@ant-design/icons';
// -----------------------------------------------------------------------------------------

export default function MainLayout() {
    const { Header, Menu, Sider, Content } = Layout;
    const [collapsed, setCollapsed] = useState(false)
    const toggle = () => {
        setCollapsed(!collapsed)
    }

    return (
        <div>
            <Layout>
                <Sider >
                    <div className="logo" />
                    <Menu>

                    </Menu>
                </Sider>
                <Layout >
                    <Header >
                    </Header>
                    <Content>
                        Content
                    </Content>
                </Layout>
            </Layout>
        </div>
    )
}
